import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useFormik } from "formik";

import styles from "./RegisterDriver.module.css";
import { TextField, Button } from "@material-ui/core";

const RegisterDriver = () => {
  const dispatch = useDispatch();

  const formik = useFormik({
    initialValues: { email: "xxss@gmail.com", password: "0592413118" },

    onSubmit: (values) => {
      console.log(values);
    },
  });

  return (
    <div className={styles.container}>
      <form className={styles.form} onSubmit={formik.handleSubmit}>
        <div className={styles.Formtitle}>Sign UP NEW Driver</div>
        <div className={styles.formGroup}>
          <TextField
            style={{ width: "50%", fontSize: "70px" }}
            name="email"
            label="Enter your email"
            variant="outlined"
            {...formik.getFieldProps("email")}
          />
          <TextField
            style={{ width: "50%", fontSize: "70px" }}
            name="name"
            label="Enter your name"
            variant="outlined"
            {...formik.getFieldProps("name")}
          />
          <TextField
            style={{ width: "50%", fontSize: "60px" }}
            name="password"
            label="Enter your Password"
            variant="outlined"
            {...formik.getFieldProps("password")}
          />
          <Button
            variant="contained"
            color="primary"
            type="submit"
            size="small"
          >
            Register
          </Button>
        </div>
      </form>
    </div>
  );
};

export default RegisterDriver;
